CREATE TABLE EJECUCION_CONSULTA
(
  EJECUCION_CONSULTA_ID NUMBER(10)     NOT NULL,
  ENTIDAD_ID            NUMBER(5),
  USUARIO_ID            NUMBER(5),
  SERVICIO_ID           NUMBER(6),
  FECHA                 DATE           DEFAULT SYSDATE NOT NULL,
  FECHA_FIN             DATE,
  CRITERIOS             VARCHAR2(1000),
  ESTADO                VARCHAR2(2)
)
NOLOGGING
COMPRESS BASIC
PARTITION BY RANGE(FECHA)
INTERVAL (NUMTOYMINTERVAL(1,'MONTH'))
(
  PARTITION PART_201701 VALUES LESS THAN (TO_DATE('2017-02-01', 'YYYY-MM-DD'))
);


